import React, { FunctionComponent } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import AboutMePage from "../pages/AboutMePage";
import ContactPage from "../pages/ContactPage";
import WelcomePage from "../pages/WelcomePage";
import PostsListPage from "./PostsListPage";
import LeftPanel from "./LeftPanel";

type MainPanelProps = {
    isActive: boolean;
};

const MainPanel: FunctionComponent<MainPanelProps> = ({ isActive }) => {
    const isActiveFlag = isActive ? " active " : "";

    return (
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<LeftPanel />}>
                    <Route
                        path="/Welcome"
                        element={<WelcomePage isActive={isActive} />}
                    />
                    <Route
                        path="/AboutMe"
                        element={<AboutMePage isActive={isActive} />}
                    />
                    <Route path="/Blog" element={<PostsListPage />} />
                    <Route
                        path="/Contact"
                        element={<ContactPage isActive={isActive} />}
                    />
                    {/*<Route path="*" element={<NoPage />} /> */}
                </Route>
            </Routes>
        </BrowserRouter>
    );
};

export default MainPanel;
